import React, { Component } from "react";
import { Link } from "react-router-dom";
import '../../styles/App.css';


class Navbar extends Component {
  render() {
    return (
      <div className="navbar-sticky">
        <nav className="z-depth-0">
          <div className="nav-wrapper white">
            <div className="left black-text mx-5">
            <Link
              to="/"
              style={{
                fontFamily: "monospace"
              }}
              className="col s5 brand-logo left black-text"
            >
              <i className="material-icons">code</i>
              JanWhere
            </Link>
            </div>
            <div className="col s7 right black-text  px-3">
                <Link to={'/'} className="btn btn-flat waves-effect white black-text">
                  Home
                </Link>
                <Link to={'/discover'} className="btn btn-flat waves-effect white black-text">
                  Discover
                </Link>
                <Link to={'/about'} className="btn btn-flat waves-effect white black-text">
                  About Us
                </Link>
                <Link to={'/contact'} className="btn btn-flat waves-effect white black-text">
                  Contact Us
                </Link>
                <Link
                  to="/login"
                  style={{
                    width: "100px",
                    borderRadius: "3px",
                    letterSpacing: "1.5px"
                  }}
                  className="btn btn-flat waves-effect white black-text"
                >
                  Log In
                </Link>
                <Link
                  to="/signup"
                  style={{
                    width: "120px",
                    borderRadius: "3px",
                    letterSpacing: "1.5px"
                  }}
                  className="btn waves-effect waves-light hoverable blue accent-3"
                >
                  Sign Up
                </Link>
              </div>
          </div>
        </nav>
      </div>
    );
  }
}

export default Navbar;
